import React from "react";

const Tip = ({ tipcars }) => {
 // console.log("tipcars:", tipcars); // Log the entire tipcars array

 
  return (
    <div>
        <p>{tipcars.nametip}</p>
        <p>{tipcars.id}</p>
    </div>
  );
};

export default Tip;
